def ApproximatePatternMatching(pattern,text,d):
    def ham(s1,s2):
        count = 0
        for i in range(len(s1)):
            if s1[i] != s2[i]:
                count +=1
        return count
    
    k = len(pattern)
    positions = []
    for i in range(len(text)-k+1):
        z = text[i:i+k]
        if ham(z,pattern) <=d:
            positions.append(i)
    return positions


pattern = "TGCACAGGCACC"

text = ""



x = ApproximatePatternMatching(pattern,text,5)

print (' '.join(str(n) for n in x))